description:
Will a little white lie lead police investigators to uncover the truth about Vicki (Kirsten Price)? Or will they discover a twisted tale of betrayal at the hands of her best friend Felecia (Alektra Blue)...one girl is dead, but which one? It's up to the police to expose a web of lies and uncover the dark secrets of these two friends...

